import '../styles/Preview.css';

const Preview = (props) => {
    const { preview } = props;
    return (
        <div className='active' style={{ background: `url(${preview})` }}>
            <div className='previewInfo'>
                One Thousand Years Ago
            </div>
        </div>
    )
};

export default Preview;
